    /**
     * Obtiene historial del portfolio
     */
    async handleGetPortfolioHistory(req, res) {
        try {
            const { period = '7d' } = req.query;
            
            // Simular datos hist√≥ricos
            const history = [];
            const now = new Date();
            let days;
            
            switch (period) {
                case '1d':
                    days = 1;
                    break;
                case '7d':
                    days = 7;
                    break;
                case '30d':
                    days = 30;
                    break;
                default:
                    days = 7;
            }
            
            for (let i = days; i >= 0; i--) {
                const date = new Date(now.getTime() - i * 24 * 60 * 60 * 1000);
                history.push({
                    timestamp: date.toISOString(),
                    value: 10000 + Math.random() * 1000,
                    profit: Math.random() * 100 - 50
                });
            }
            
            res.json({
                success: true,
                data: history
            });
        } catch (error) {
            this.logger.error('Error obteniendo historial de portfolio:', error);
            res.status(500).json({
                success: false,
                error: 'Error interno del servidor'
            });
        }
    }
    
