async function testDirectTelegram() {
  const https = require("https")

  const botToken = process.env.TELEGRAM_BOT_TOKEN
  const chatId = process.env.TELEGRAM_CHAT_ID

  if (!botToken || !chatId) {
    console.log("\n‚ùå No se puede probar: faltan credenciales")
    return
  }

  console.log("\n=== PROBANDO ENV√çO DIRECTO ===")

  const message = `üîß Test directo: ${new Date().toLocaleString()}`

  const data = JSON.stringify({
    chat_id: chatId,
    text: message,
    parse_mode: "HTML",
  })

  const options = {
    hostname: "api.telegram.org",
    port: 443,
    path: `/bot${botToken}/sendMessage`,
    method: "POST",
    headers: {
      "Content-Type": "application/json",
      "Content-Length": data.length,
    },
  }

  const req = https.request(options, (res) => {
    let responseData = ""

    res.on("data", (chunk) => {
      responseData += chunk
    })

    res.on("end", () => {
      try {
        const response = JSON.parse(responseData)
        if (response.ok) {
          console.log("‚úÖ √âXITO: Mensaje enviado a Telegram")
          console.log("Detalles:", response.result)
        } else {
          console.log("‚ùå ERROR de Telegram:", response.description)
        }
      } catch (error) {
        console.log("‚ùå Error parseando respuesta:", error.message)
        console.log("Respuesta cruda:", responseData)
      }
    })
  })

  req.on("error", (error) => {
    console.log("‚ùå Error de conexi√≥n:", error.message)
  })

  req.write(data)
  req.end()
}

// Ejecutar prueba
