import React, { useState, useEffect } from "react";

function AnomalyDetectionPanel() {
  const [anomalies, setAnomalies] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch("/api/anomalias")
      .then(res => res.json())
      .then(data => {
        setAnomalies(data.anomalias || []);
        setLoading(false);
      })
      .catch(() => setLoading(false));
  }, []);

  return (
    <div id="anomalies" className="panel">
      <h3>Detecci√≥n de Anomal√≠as</h3>
      {loading ? (
        <div className="text-muted">Cargando...</div>
      ) : anomalies.length === 0 ? (
        <div className="text-muted">No se detectaron anomal√≠as recientes.</div>
      ) : (
        <ul>
          {anomalies.map((anomaly, i) => (
            <li key={i}>
              <strong>{anomaly.type || anomaly.categoria || "Anomal√≠a"}</strong>
              {anomaly.timestamp && (
                <> ({new Date(anomaly.timestamp).toLocaleString()})</>
              )}
              {anomaly.descripcion && (
                <>: {anomaly.descripcion}</>
              )}
              {anomaly.message && !anomaly.descripcion && (
                <>: {anomaly.message}</>
              )}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default AnomalyDetectionPanel;

