import React, { useState, useEffect } from "react";

export default function SimulationSwitch() {
  const [simulating, setSimulating] = useState(false);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    // Consulta si el modo simulaci√≥n est√° activo
    fetch("/api/simulation/status")
      .then(res => res.json())
      .then(data => setSimulating(!!data.simulation))
      .catch(() => setSimulating(false));
  }, []);

  const handleToggle = () => {
    setLoading(true);
    fetch(`/api/simulation/${simulating ? "off" : "on"}`, { method: "POST" })
      .then(() => setSimulating(!simulating))
      .finally(() => setLoading(false));
  };

  return (
    <div id="simulation-switch" className="panel">
      <h3>Modo Simulaci√≥n</h3>
      <button onClick={handleToggle} disabled={loading}>
        {simulating ? "Desactivar Simulaci√≥n" : "Activar Simulaci√≥n"}
      </button>
      <p>
        Estado actual: <b>{simulating ? "Simulaci√≥n activa" : "Simulaci√≥n desactivada"}</b>
      </p>
    </div>
  );
}

